import { createRouter, createWebHistory } from "vue-router";
// import Header from "../components/header_component.vue";
import ProductList from "../components/product_list.vue";
import Login from "../components/login_user.vue";
import Register from "../components/register_user.vue";


import CACA from '../components/header_component.vue';
import PIPI from '../components/footer_component.vue';
/*import admin from "../views/Admin.vue";*/

const routes = [
  {
    path: '/',
    name: "Menu",
    component: ProductList,

  },
  {
    path: '/',
    name: "header",
    component: CACA,
  },
  {
    path: '/',
    name: "footer",
    component: PIPI,
  },
  {
    path: '/login',
    name: "login_user",
    component: Login,
    beforeEnter: () => {
      import('../styles/style2.css')
    }
  },
  {
    path: '/products/:id',
    name: "PRODUCTS",
    component: ProductList,
    props: true
  },
  /*{
    path: '/login',
    name: "LOGIN",
    component: login,
  },*/
  {
    path: '/register',
    name: "register_user",
    component: Register,
    beforeEnter: () => {
      import('../styles/style3.css')
    }
  },
  /*{
      path: '/admin',
      name: "ADMIN",
      component: Admin,
  }*/
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
